import React, { Component } from "react";
import Slider from "react-slick";


export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
	  vertical:true,
	  verticalSwiping:true
    };
    return (
		<div data-slick='{"slidesToShow": 4, "slidesToScroll": 4}'>
		<div><h3>1</h3></div>
		<div><h3>2</h3></div>
		<div><h3>3</h3></div>
		<div><h3>4</h3></div>
		<div><h3>5</h3></div>
		<div><h3>6</h3></div>
	  </div>
    );
  }
}
